import NoteContext from "./noteContext";

const NoteState = (props) =>{
    const notes={
        
            "_id": "6582973dc6aac7d1917a36d3",
            "user": "658282491ac5fb1b11772bab",
            "title": "Exam Time",
            "description": "After 15 Days i have an Exams",
            "tag": "furastation",
            "date": "2023-12-20T07:26:53.609Z",
            "__v": 0
          ,
          
            "_id": "65ace945efa3cd56502523a7",
            "user": "65a93c428cabca1953d1676b",
            "title": "Music Session",
            "description": "music Session at 7'O clock ",
            "tag": "fell free",
            "date": "2024-01-21T09:52:05.956Z",
            "__v": 0
          
    }
    return(
        <NoteContext.Provider value={{notes}}>
            {props.children}
        </NoteContext.Provider>
    )
}
export default NoteState;
